text:
 @99Gara99  Eu não torço pro Galo, mas faço apostas no mercado da Série A e o q eu via nessa época era:
-Ele a início tinha mantido o esquema tático do Cuca, pra conhecer os jogadores e, na época da má fase, ele tava implementando mudanças para o estilo de jogo dele; 
- Varios jogadores do elenco (exemplo Nacho, Vargas, Arana) não tavam em boa fase e, o time sentiu mt ofensivamente;
Como a torcida queria a qualquer custo ganhar a Libertadores e, tava claro que aquele elenco estava (está) no limite da vida útil, deu no que deu... trocou o treinador e o time não deu "reset", só sentiu mais...

 @gustavohassan9393  Sim vdd, o termo "complexo" que usei foi mais maneira de falar, pois olhando a mídia esportiva vejo 2 coisas:
- SP eh o Estado que eh centro de boa parte dos veículos de comunicação e, historicamente é mt bairrista (o que eh até natural puxar sardinha para os times de sp);
- No Rio, há o problema do grupo Globo que, não apenas tem uma intenção editorial velada em engrandecer o Flamengo, mas tbm desmerece nos seus veículos de comunicação o feito dos seus rivais (tipo nenhuma vitória em Libertadores do Vasco, ou titulo carioca do Fluminense vai estampar em destaque na capa do Globo).
Brasil ainda tem uns conflitos regionais velados, que no futebol gostam de desconversar...
Esse assunto em si dá um bom debate. Mas, o melhor pro futebol brasileiro seria abrir mais o protagonismo pra fora de Rio/Sp msm, até pra ganhar mais dinheiro.
O que eu vejo dos Menin, é meio que a intenção de criar um clube forte internacionalmente de bandeira de Minas Gerais pra rivalizar com o Eixo Rio/Sp.

 @joaovitorfonseca9788  claro q é uma fase... Mas nunca q o galo vai desistir de jogar melhor vc pode até falar q o Cruzeiro ganhou mas como é série B é fácil né a série a é outro nível kkkkk.
Eu não vou mais discutir nem ferrando.
Pode falar o que quiser.

